### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **System Commands and File Operations**
- **Commands and Options:**
  - `mkdir`: Create directories.
    - Options: `-p` (create parent directories), `-m` (set permissions).
  - `rmdir`: Remove directories.
  - `touch`: Create empty files.
  - `rm`: Remove files and directories.
  - `ls`: List directory contents.
    - Options: `-i` (show inode numbers), `-l` (long listing format).
  - `chmod`: Change file permissions.
    - Symbolic modes: `u` (user), `g` (group), `o` (others), `a` (all).
    - Permissions: `r` (read), `w` (write), `x` (execute).
  - `chown`: Change file owner and group.
  - `chgrp`: Change group ownership.

- **File Permissions:**
  - Numeric modes: `750` (owner: read/write/execute, group: read/execute, others: none).

#### 2. **Text Processing and Regular Expressions**
- **Commands:**
  - `grep`: Search for patterns in files.
    - Options: `-o` (show only the matching part), `-c` (count matching lines).
  - `cut`: Extract sections from each line of files.
    - Options: `-d` (delimiter), `-f` (field).
  - `sort`: Sort lines of text files.
  - `uniq`: Remove duplicate lines.
  - `tail`: Output the last part of files.
    - Options: `-1` (output the last line).
  - `wc`: Count lines, words, and characters.
    - Options: `-l` (count lines).

- **Regular Expressions:**
  - Matching patterns: `"address":\s*"[^"]+"` (match "address" field in JSON).
  - MAC address pattern: `[0-9A-Fa-f]{2}:[0-9A-Fa-f]{2}:[0-9A-Fa-f]{2}:[0-9A-Fa-f]{2}:[0-9A-Fa-f]{2}:[0-9A-Fa-f]{2}`.

#### 3. **Process Management**
- **Commands:**
  - `&`: Run commands in the background.
  - `$!`: Get the PID of the last background process.
  - `echo`: Display a line of text.
  - `ps`: Display information about active processes.
  - `kill`: Terminate processes.

#### 4. **SSH and Security**
- **Commands:**
  - `ssh`: Secure Shell for remote login.
  - `ssh-keygen`: Generate, manage, and convert authentication keys.
    - Options: `-R` (remove host key), `-t` (specify key type), `-b` (specify key length).
  - `scp`: Secure copy over SSH.
  - `sftp`: Secure file transfer over SSH.

- **Error Handling:**
  - "Host key verification failed": Indicates a change in the remote host's key or a potential security issue.

#### 5. **Data Integrity and Checksums**
- **Commands:**
  - `sha256sum`: Compute and check SHA256 message digests.
    - Options: `-c` (check checksums).
  - `md5sum`: Compute and check MD5 message digests.
  - `cksum`: Compute and check CRC checksums.

#### 6. **Shell Scripting and Redirection**
- **Commands:**
  - `echo`: Display a line of text.
  - `tee`: Read from standard input and write to standard output and files.
  - `exec`: Execute commands and open/close file descriptors.
  - `script`: Make a typescript of a terminal session.
  - Redirection operators: `>`, `>>`, `2>`, `2>&1`, `|`.

#### 7. **Vi and Emacs Editors**
- **Vi Commands:**
  - Navigation: `7G` (go to line 7).
  - Deletion: `dd` (delete line).
  - Save and exit: `:wq` (save and quit).

- **Emacs Commands:**
  - Navigation: `M-g M-g` (go to line).
  - Deletion: `C-a C-k` (delete line).
  - Save and exit: `C-x C-s` (save), `C-x C-c` (exit).

